    data: |
      SELECT ALL + 46 - - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( ( NOT ( ( + - 93 * col0 ) > ( + col1 ) ) ) );
  - name: tab1

outputs:
  - name: q8364.out
    data: |
      51
      60
      93
